library(shiny)
library(bslib)
source("plot_functions.R")
source("datagather.R")





ui <- fluidPage(
  titlePanel("VME Advice Framework"),
  sidebarLayout(
    sidebarPanel(
    selectInput("taxa", "VME Taxa",choices=taxa,width="100%"),
    
    checkboxGroupInput(
      "models", "Models to use",
      choices =NULL,selected="Gorgonians",width="100%")
    ),
     # Add a horizontal rule
 #   checkboxInput("by_species", "Show species", TRUE),
 #   checkboxInput("show_margins", "Show marginal plots", TRUE),
 #   checkboxInput("smooth", "Add smoother"),
 # ),#,
 # plotOutput("scatter")

 
mainPanel(plotOutput("mapPlot"))), 

#card(
#   ,
# ),

card(sidebarLayout(sidebarPanel(
  conditionalPanel(condition="input.models.includes('C-squares (observations)')",
                 sliderInput("cweight","Observation weight",min=0,max=1,value=1,width="100%")
                 ),
conditionalPanel(condition="input.models.includes('Yesson et al. 2017')",
                 sliderInput("yweight","Yesson 2017 weight",min=0,max=1,value=0.77,width="100%")
),
conditionalPanel(condition="input.models.includes('Yesson et al. 2012')",
                 sliderInput("yweight","Yesson 2012 weight",min=0,max=1,value=0.62,width="100%")
),
conditionalPanel(condition="input.models.includes('Tong et al. 2023')",
                 sliderInput("tweight","Tong 2023 weight",min=0,max=1,value=0.78,width="100%")
),
conditionalPanel(condition="input.models.includes('Chu et al. 2019')&input.taxa.includes('Gorgonians')",
                 sliderInput("chweight","Chu 2019 weight",min=0,max=1,value=.61,width="100%")
),
conditionalPanel(condition="input.models.includes('Chu et al. 2019')&input.taxa.includes('Antipatharians')",
                 sliderInput("chweight","Chu 2019 weight",min=0,max=1,value=.84,width="100%")
),
conditionalPanel(condition="input.models.includes('Rooper et al. 2024')&input.taxa.includes('Gorgonians')",
                 sliderInput("rweight","Rooper 2024 weight",min=0,max=1,value=.81,width="100%")
),
conditionalPanel(condition="input.models.includes('Rooper et al. 2024')&input.taxa.includes('Antipatharians')",
                 sliderInput("rweight","Rooper 2024 weight",min=0,max=1,value=.90,width="100%")
)),
mainPanel( plotOutput("vme_plot")),

),
mainPanel( plotOutput("sd_plot"))
)
)


server <- function(input, output,session) {
   input_dataset<-reactive({
     if(input$taxa=="Gorgonians"){return(((gorgonian_stack)))
     } else {
         return(((antipatharian_stack)))}
   })

  
  
  
   observeEvent(input$taxa, {
     freezeReactiveValue(input, "models")
     updateCheckboxGroupInput(session = session, inputId = "models", choices = names(input_dataset()))
   })
   
   
   
  output$mapPlot <- renderPlot({
     #g3<-grid.arrange(grobs=make_map(input_dataset())) 

    g3<-grid.arrange(grobs=make_map(input_dataset()[[names(input_dataset())%in%input$models]]),nrow=1)
    print(g3)
   })
  
  output$vme_plot<-renderPlot({ 
   rstack<-rast()
   if('C-squares (observations)'%in%input$models){o1<-input_dataset()[[names(input_dataset())=='C-squares (observations)']]*input$cweight
   rstack<-c(rstack,o1)}
   if('Yesson et al. 2012'%in%input$models){o1<-input_dataset()[[names(input_dataset())=='Yesson et al. 2012']]*input$yweight
   rstack<-c(rstack,o1)}
   if('Yesson et al. 2017'%in%input$models){o1<-input_dataset()[[names(input_dataset())=='Yesson et al. 2017']]*input$yweight
   rstack<-c(rstack,o1)}
   if('Tong et al. 2023'%in%input$models){o1<-input_dataset()[[names(input_dataset())=='Tong et al. 2023']]*input$tweight
   rstack<-c(rstack,o1)}
   if('Chu et al. 2019'%in%input$models){o1<-input_dataset()[[names(input_dataset())=='Chu et al. 2019']]*input$chweight
   rstack<-c(rstack,o1)}
   if('Rooper et al. 2024'%in%input$models){o1<-input_dataset()[[names(input_dataset())=='Rooper et al. 2024']]*input$rweight
   rstack<-c(rstack,o1)}
   
   antipatharia_total<-app(rstack,fun="sum",na.rm=TRUE)
   antipatharia_breaks<-getBreaks(values(antipatharia_total),nclass=3,method="jenks")
   antipatharia_vme<-terra::classify(antipatharia_total,rcl=antipatharia_breaks)
   antipatharia_sd<-app(rstack,fun="sd",na.rm=TRUE)
   

   g2<-grid.arrange(grobs=c(make_vme_plot(antipatharia_vme),make_sd_map(antipatharia_sd),make_hist(antipatharia_total)),nrow=1) 
   print(g2)
    
  })
  
}

# Run the application 
shinyApp(ui = ui, server = server)
